import { StyleSheet } from "react-native";  

const styles = StyleSheet.create({
    containerCart: {
        flexDirection: 'row',
        justifyContent: 'space-between',
    },
    item1: {
        width: '25%',
    },
    img: {
        width: '90%',
        height: 110,
        borderRadius: 10
    },
    item2: {
        width: '55%'
    },
    item3: {
        width: '20%'
    },
    imgShiper: {
        width: 24,
        height: 24
    }
});

export default styles;
